        <label>Password:</label>
        <input
          type="password"
          required
          placeholder="Enter the password"
          className="inp"
          value={pass}
          onChange={(e) => setPass(e.target.value)}
        />
        <br />
        <button><Link to="/Home">Sign In</Link></button>
      </form>
    </div>
    </>
  )
}
}
export default Signin
